Maxi-Cosi Titan Pro ADAC’lı I-SIZE ISOFIX'li, 9-36 KG, Yatabilen Bebek ve Çocuk Oto Koltuğu 

 

Maxi Cosi Titan Pro ADAClı Çocuk Oto Koltuğu yenilikçi G-CELL ve AirProtect® Güvenlik Teknolojisi ile çocuğunuzla birlikte büyümek için Tasarlandı

Neden Seçmeliyim?

 
Bambu Kumaş 
 
G-Cell ve Airprotect Teknolojisi 
 
11 Kademeli Yükseklik Ayarı 
 
9 Aydan 12 Yaşa Kadar Kullanım (9-36kg) 



Çocuğunuz ile Beraber Büyür 
Maxi Cosi Titan Pro ADAClı Çocuk Oto Koltuğunun Airprotect® teknolojisine sahip akıllı GrowSafe baş desteğiyle, 9 aydan 12 yaşa kadar koltuğun bir sonraki yaş kategorisine ayarlamanın tam olarak ne zaman olacağını bilirken, patentli GCell teknolojisi de çocuğunuza ek yan darbe koruması sağlar. 
 

G-Cell 2.0 Teknolojisi, yandan çarpma anında bebeğe gelen basıncı, kasa içindeki petek yapı sayesinde, tek noktadan çok noktaya doğru yayar aracın şasesine doğru itilir ve tek noktadan alınacak sert basınç absorbe edilmiş olur. Bu sayede özellikle bebeğinizin yandan alabileceği sert darbeler önlenmiş olur. 


 

5 Noktalı Emniyet Kemeri
Küçük çocuğunuzu sabitlemek için 5 noktalı emniyet kemeriyle birlikte kullanılan Maxi Cosi Titan Pro ADAClı Çocuk Oto Koltuğu, çocuğunuz büyüdükçe normal 3 noktalı araba kemerini kullanarak güvenli bir şekilde 2/3 grup çocuk oto koltuğuna dönüştürebilir.

Yenilikçi G Cell ve AirProtect® Güvenlik Teknolojisi



Titan Pro'da Yeni Teknoloji: G-CELL
Maxi Cosi olarak çocuğunuzun güvenliği söz konusu olduğunda, en son teknolojiyi ve en gelişmiş güvenlik yeniliklerini ararız ve oto koltuklarımıza dahil ederiz. G-CELL, gelecek nesil darbe emici teknolojisi Maxi-Cosi'nin patentli bir yeniliğidir. Doğadan ilham alan G-CELL teknolojisi, petek veya kar taneleri gibi altıgen bir şekle sahiptir. Bu özel yapı oto koltuğunun yan panellerine yerleştirilmiştir. Yan çarpışma durumunda, özellikle omuz bölgesi için çocuğunuzun vücudundaki etkiyi azaltmaya yardımcı olur. 
 

ISOFIX ve Top Tether Bağlantısı
ISOFIX ve Top Tether bağlantısı, koltuğun araca güvenli bir şekilde bağlı kalmasını sağlar. 

 

Maxi Cosi Titan Pro ADAClı Çocuk Oto Koltuğu, sırtta ve koltuk başlığındaki yumuşak dolgulu kumaşı sayesinde daha uzun araba yolculuklarında bile maksimum konfor sağlar. Bambu kumaştan yapılmış koltuk kılıfı nefes alabilir ve sıcaklık düzenleyici özelliklere sahiptir. Maxi Cosi Titan Pro ADAClı Çocuk Oto Koltuğu, farklı dinlenme pozisyonlarına ihtiyaç duyulması halinde 3 konforlu oturma ve dinlenme pozisyonu sunuyor. 


 

Titan Pro'da güvenli teknoloji: AirProtect®
Baş bölümündeki özel koruma ise, kafalıkta bulunan sıkıştırılmış hava ile çalışan mekanik sistem AirProtect® ile sağlanır. Baş destek bölümündeki patentli AirProtect yan darbe koruması, baş yaralanma riskini %20 oranında azaltır! Kafalıktaki benzersiz pnömatik yastıklama yan panellerdeki yenilikçi, çarpma emici G-CELL teknolojisi, özellikle omuz bölgesinde, gelişmiş yan darbe koruması sağlar.

Konforlu Tasarım
Maxi Cosi Titan Pro ADAClı Çocuk Oto Koltuğu, ayrıca koltukta, sırt kısmında ve koltuk başlığında yumuşak bir dolguya sahiptir, bu da uzun yolculuklarda yüksek düzeyde konfor sağlar. Bambu kumaştan yapılmış koltuk kılıfı nefes alır ve sıcaklık düzenleyici özelliğe sahip olup her yolculukta küçüklerinizi doğru sıcaklıkta tutar. 



Güvenlik
GCELL ve AirProtect® teknolojisi sayesinde ekstra güvenlidir ve bu nedenle çocuğunuzu bir çarpışma durumunda en iyi şekilde korur. Isofix bağlantısı ve üst bağlantı kemerinin doğru bağlanıp bağlanmadığını gösterir. Grup 1 – 9-18kg çocuk oto koltuğu olarak kurulum: Isofix ve Top Tether ile Grup 2/3 – 15-36kg çocuk oto koltuğu olarak kurulum: Isofix ile 5 noktalı emniyet kemeri yürümeye başlayan çocukların güvenliği için en iyi güvenliği sağlar. Avrupa güvenlik standardı ECE R44 / 04 ile uyumludur. 
 

Genel Özellikler

- Güvenle büyüyen akıllı GrowSafe baş desteği ile birlikte mükemmel kafa uyumu için 11 farklı yükseklik pozisyonuna kolay ayarlanabilen koltuk başlığı
- Sürüş yönünde doğru 9 aydan 12 yaşa kadar kullanım
- Eşzamanlı ve kolay ayarlanabilir emniyet kemeri ve koltuk başlığı
- Yenilikçi otomatik olarak açılabilen Y emniyet kemer sistemi sayesinde saniyeler içinde çocuğunuzu koltuğa oturtabilir ya da koltuktan alabilirsiniz
- Yumuşak kemer koruyucuları
- Dik konumdan rahat bir uykuya kadar, 3 farklı pozisyonda yaslanma
- Rahat kalın ve yumuşak dolgulu bambu kumaştan yapılmış nefes alabilir koltuk kılıfı ekstra konfor sunar
- Bardaklık sayesinde içeceğini yerleştirme imkanı

