Ürün Ölçüleri 

Ürün Videoları


Her Yolculuğu, çocuğunuz için daha güvenli hale getirmek için çarpışma testleri yapıyoruz.
Son teknolojiye sahip oto koltuğu test tesislerimizde, bebek ve çocuk oto koltuklarını tasarlamak, üretmek ve test etmek için gereken tüm donanıma sahibiz. Maxi-Cosi test merkezlerimiz, bebek ve çocuk ürünlerine en son yenilikleri uygulamak için, oto koltuğu endüstrsinin en iyi araştırma, tasarım ve teknolojisini bir araya getiriyor. 

Oto koltuğu çarpışma testleri nasıl yapılır?
300'e kadar sensörlü kameralar ve her çocuğun boy ve kilosuna özel mankenler kullanarak, araba koltuklarımızın, bir araba kazasında, bebeğinizi ve çocuğunuzu ne kadar iyi koruyacağını tam olarak ölçüyoruz. En iyi güvenlik seviyelerine ulaştığımızdan emin olmak için bir oto koltuğunun geliştirilmesi sırasında, 1.000'e kadar çarpışma testi gerçekleştiriyoruz. Bu bebek ve çocuk oto koltuğu çarpışma testi sonuçlarını, ürünlerimizi sürekli olarak geliştirmek ve iyileştirmek için de kullanıyoruz. 

Neden kendi oto koltuğu güvenlik testlerimizi kullanıyoruz?
